import React from 'react';
import Main from './Components/Main';
import './Components/style.css';
import EditForm from './EditFrom';
function App() {
  return (
    <>
      <Router>
      <Switch>
        <Route path="/" exact component={Main} />
        <Route path="/edit/:id" component={EditForm} />
      </Switch>
    </Router>
    </>
  );
}

export default App;
